import React from 'react'
import { useState } from 'react'

function Hw() {
    const [trafficLights, setTrafficLights] = useState(1)
    const changeTrafficLights = () => {
        console.log('changeTrafficLights');
    }
  return (
    <div>
        <button onClick={changeTrafficLights}>Next</button>
    </div>
  )
}

export default Hw
